import { message } from 'antd'
import ajax from './ajax'

import request from './request'

// const BASE = 'http://localhost:5000'
const BASE = ''

export const reqLogin = (username, password) => ajax(BASE + '/login', { username, password }, 'POST')


export const RealtimeData_Request = (parameter, line, page) => ajax('https://iotcs.app/read_realtime/',
    {
        "csrfmiddlewaretoken": "csrftoken",
        "Site": "Polymerlink",
        "Line": line,
        "Page": page,
        "Parameters": parameter
    },
    'POST')

export const graph_request = (parameter, datetimeStart, datetimeEnd, line) => ajax('https://iotcs.app/read_logdata/',
    {
        "csrfmiddlewaretoken": "csrftoken",
        "Site": "Polymerlink",
        "Line": line,
        "Parameters": parameter,
        "DateTime": [datetimeStart, datetimeEnd],
    },
    'POST')

export const logdata_request = (parameter, datetimeStart, datetimeEnd, line, page) => ajax('https://iotcs.app/read_logdata/',
    {
        "csrfmiddlewaretoken": "csrftoken",
        "Site": "Polymerlink",
        "Line": line,
        "Parameters": parameter,
        "DateTime": [datetimeStart, datetimeEnd],
        "Page": page
    },
    'POST')

export const logdata_Write = (parameter, line, page) => ajax('https://iotcs.app/write_logdata/',
    {
        "csrfmiddlewaretoken": "csrftoken",
        "Site": "Polymerlink",
        "Page": page,
        "Line": line,
        "Data": parameter
    },
    'POST')

export const write_setting = (parameter, line) => ajax('https://iotcs.app/write_setting/',
    {
        "csrfmiddlewaretoken": "csrftoken",
        "Site": "Polymerlink",
        "Line": line,
        "Data": parameter
    },
    'POST')

export const delete_logdata = (parameter, datetimeStart, datetimeEnd, line, page) => ajax('https://iotcs.app/read_logdata/',
    {
        "csrfmiddlewaretoken": "csrftoken",
        "Site": "Polymerlink",
        "Line": line,
        "Parameters": parameter,
        "DateTime": [datetimeStart, datetimeEnd],
        "Page": page
    },
    'POST')

export const LoginBackend = (username, password) => request('https://www.iotcs.app/api/login/',
    {
        "username": username,
        "password": password
    },
    'POST')

export const LogoutBackend = () => request('https://www.iotcs.app/api/logout/',
    {

    },
    'POST')

export const testapi = () => request('https://www.iotscs.app/api/test2/',
    {

    },
    'POST')
